" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Rationale for and mechanisms of benefit of cardiac resynchronization therapy",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?10/36/10823/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?10/36/10823/contributors\">",
"     Leslie A Saxon, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?10/36/10823/contributors\">",
"     Teresa DeMarco, MD",
"    </a>",
"    <br/>",
"   </div>",
