"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?10/36/10823/abstract/1\">",
"      Leclercq C, Kass DA. Retiming the failing heart: principles and current clinical status of cardiac resynchronization. J Am Coll Cardiol 2002; 39:194.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?10/36/10823/abstract/2\">",
"      Abraham WT, Hayes DL. Cardiac resynchronization therapy for heart failure. Circulation 2003; 108:2596.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?10/36/10823/abstract/3\">",
"      Auricchio A, Abraham WT. Cardiac resynchronization therapy: current state of the art: cost versus benefit. Circulation 2004; 109:300.",
"     </a>",
